import React from 'react';
import s from './app.module.css';
import Header from '../header/header';
import Navbar from '../nav-bar';
import Profile from '../profile';
import Dialogs from '../dialogs';


const App = () => {
  return (
    <div className={s.appWrapper}> 
    <Header />
    <Navbar />
    {/* <Profile />  */}
    <Dialogs />
    </div>
  );
}

export default App;
